import logo from 'src/components/peach.png';

function Navbar() {
  return (
    <nav className="Navbar">
      <img src={logo} className="App-logo" alt="logo" />
      <p>
        What I gotta do.
      </p>
    </nav>
  );
}

export default Navbar;
